import React from 'react';
import './search.css';

function search() {
  return (
    <div className="form-container">
      <div className="form-group">
        <label htmlFor="district">Enter District</label>
        <input type="text" id="district" className="input-box" />
      </div>

      <div className="form-group">
        <label htmlFor="stream">Enter Stream</label>
        <input type="text" id="stream" className="input-box" />
      </div>

      <div className="form-group z-range-group">
        <label>Enter Z-Range</label>
        <div className="z-range-inputs">
          <input type="text" className="z-range-box" placeholder="Min" />
          <input type="text" className="z-range-box" placeholder="Max" />
        </div>
      </div>
    </div>
  );
}

export default search;
